import'./Header.css'
function Header() {
    return (
        <div className='header-site'>
            <h1 className='header-site__name'>Some <br/>
                Name</h1>
            <h2 className='header-site__profession'><i>Developer</i></h2>
            <div className='header-site__info-container'>
                <h3 className='header-site__profession-info'>CONTACT INFO:</h3>
                <ul className='header-site__list'>
                    <li>Telegram: <a href="https://web.telegram.org/" target="_blank">@Liseczkij</a></li>
                    <li>Mail: <a href="https://www.gmail.com/mail/help/intl/ru/about.html?de." target="_blank">liseczkij2@gmai.com</a></li>
                    <li>Instagram: <a href="https://www.instagram.com/lisetskiiy__/">lisetskiiy__</a></li>
                </ul>
            </div>
        </div>
    );
}
export default Header;
